import React from 'react'
import './team.css'
import {
    Card,
    CardImg,
    CardBody,
    CardTitle,
    CardText,
}from 'reactstrap'

class team extends React.Component{

    container2(){
        return(
            <div id = 'aboutWorkshop'>
                        <Card width = '10%'>
                            <CardImg top height = '200px'   alt="Card image cap1" />
                            <CardBody color>
                                <CardTitle>
                                    Workshops
                                </CardTitle>
                                <CardText>
                                    An entire day of informative workshops
                                </CardText>
                            </CardBody>
                        </Card>
                    </div>
        )
    }
    render(){
        return (
            <div>
                <div>
                    {this.container2()}
                </div>
            </div>
        )
    }
}

export default team
